import React from 'react';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import './fileUpload.css';

function fileupload() {
    return (
        <div className='file_upload'>
            <input type='file' >Upload</input>
            <CloudUploadIcon />
        </div>
    )
}

export default fileupload
